import { format } from "date-fns";
export const COLUMNS = [
  {
    Header: "Id",
    accessor: "_id",
    disableFilters: true,
  },
  {
    Header: "Center",
    accessor: "center",
  },
  {
    Header: "Date",
    accessor: "date",
    Cell: ({ value }) => {
      return format(new Date(value), "dd/MM/yyyy");
    },
  },
  {
    Header: "Price",
    accessor: "price",
    Cell: ({ row }) => `$${row.original.price}$`,
  },
  {
    Header: "Duration",
    accessor: "duration",
  },
];
